import {Navbar,Tabs,Tab} from 'react-bootstrap';
import './projectnavbar.css';
import Dashboard from '../dashboard/dashboard';
function ProjectNavBar()
{
    return (
        <div>
    {/* <Navbar className='projectNavBar'>
            <Navbar.Brand className='projectNavBarItem' href='#Home'>Overview</Navbar.Brand>
            <Navbar.Brand className='projectNavBarItem' href=''>List</Navbar.Brand>
            <Navbar.Brand className='projectNavBarItem' href=''>Timeline</Navbar.Brand>
            <Navbar.Brand className='projectNavBarItem' href=''>Calendar</Navbar.Brand>
            <Navbar.Brand className='projectNavBarItem' href='#Dashboard'>Dashboard</Navbar.Brand>
            <Navbar.Brand className='projectNavBarItem' href=''>More</Navbar.Brand>
    </Navbar> */}
    
    <Tabs defaultActiveKey="Dashboard">
        <Tab eventKey="Overview"></Tab>
        <Tab eventKey="List"></Tab>
        <Tab eventKey="Timeline"></Tab>
        <Tab eventKey="Calendar"></Tab>
        <Tab eventKey="Dashboard"></Tab>
        <Tab eventKey="More"></Tab>
    </Tabs>
    </div>
    );
}

export default ProjectNavBar;
